import React from "react";
import { RowFlex, ColumnFlex } from "../../styles";
import { HeavyText, LightText } from "./styles";

export default function Header() {

  return (
    <RowFlex>
      <ColumnFlex>
        <HeavyText>
        Stadium Antics
        </HeavyText>
        <LightText>
        Rumor has it a new pair of Jordans make ants run faster...
        </LightText>
      </ColumnFlex>
    </RowFlex>
  );
}
